import classes from './Meals.module.css';
import React from 'react';
import MealsSummary from './MealsSummary'
import AvailableMeals from './AvailabeMeals';
const Meals = props => {
    return (
        <React.Fragment>
            <MealsSummary />
            <AvailableMeals />
        </React.Fragment>
    )
}

export default Meals;
